doc.solution:
Since $33^{-1} \equiv 77 \pmod{508}$, \begin{align*}
11^{-1} &\equiv (33 \cdot 3^{-1})^{-1} \\
&\equiv 33^{-1} \cdot 3 \\
&\equiv 77 \cdot 3 \\
&\equiv \boxed{231} \pmod{508}.
\end{align*}

